		function drawView(s, c) {
		
			if (c == '#ffffff' && !isblackAdded) {
		
				addblack();
			} else if (c != '#ffffff' && isblackAdded) removeBlack();
		
		
			that.line.graphics.clear();
		
		
			that.line.graphics.setStrokeStyle(s * 0.8).beginStroke(c);
		
			that.line.graphics.moveTo(-40, 0);
		
		
		
			that.line.graphics.lineTo(38, 0);
		
			that.line.regY = that.height / 2;
		
			that.line.graphics.endStroke();
		
		}
		
		that.drawView = drawView;
		
		function addblack() {
		
			that.rect = new createjs.Shape();
			isblackAdded = true;
			that.addChild(that.rect);
			that.rect.graphics.beginFill("black").drawRect(-50, -26.6, 100, 52);
			that.addChild(that.line);
		
		}
		
		function removeBlack() {
		
			that.removeChild(that.rect);
			isblackAdded = false;
		
		}
