		var twoFinger = false;
		
		
		
		
		function onmousedown(e) {
		
		
			console.log('onmousedown finger e.pointerID ', e.pointerID)
		
			cont.isDragged = false;
			twoFinger = false;
		
		
			cont.addEventListener("pressmove", onpressmove);
		
		
			previous_x_update = false;
		
			var pt = that.globalToLocal(e.stageX, e.stageY);
			var posX = pt.x;
			var posY = pt.y;
			e.currentTarget.offset = {
				x: posX - e.currentTarget.x,
				y: posY - e.currentTarget.y
			};
		
			e.currentTarget.down = {
				x: posX,
				y: posY
			};
		
		
			var ptc = cont.globalToLocal(e.stageX, e.stageY);
			console.log('pt ', pt.x)
			console.log('ptc ', ptc.x)
		
			if (e.pointerID === -1) e.pointerID = 0;
			console.log('add fonger mousedown ', e.pointerID)
			fingers[e.pointerID] = {
				start: {
					x: e.stageX,
					y: e.stageY
				},
				current: {
					x: e.stageX,
					y: e.stageY
				},
				old: {
					x: e.stageX,
					y: e.stageY
				},
			};
		
		
			calculateActiveFingers();
		
			if (activeFingers === 2) {
				twoFinger = true;
				cont.cache(-10, 0, cont.getTransformedBounds().width, cont.getTransformedBounds().height);
			}
		}
		
