		function repositionTouchContainer() {
		
		
			var diff = (cont.x - (firstwidth / 2 + offsetX));
		
			cont.x = cont.x - diff * (1 / (scalTouchfactor + 1));
		
		
		
			diff = (cont.y - (firstheight / 2 + offsetY));
		
			cont.y = cont.y - diff * (1 / (scalTouchfactor + 1));
		
		
		}
		
		
		
