		function dragable(obj) {
		
		
			var current = null;
			var mins = null;
			var objTransWidth = null;
			var objTransHeight = null;
		
			obj.addEventListener("mousedown", function (e) {
		
				obj.isdraged = false;
				current = e.currentTarget.name;
		
				objTransWidth = obj.getTransformedBounds().width;
				objTransHeight = obj.getTransformedBounds().height;
				var toolBtnTransHeight = that.tool_btn.getTransformedBounds().height;
		
		
				mins = lib.properties["height"] - toolBtnTransHeight;
		
		
				var global = obj.parent.localToGlobal(obj.x, obj.y);
				obj.offset = {
					'x': global.x - e.stageX,
					'y': global.y - e.stageY
				};
		
				obj.addEventListener("pressmove", dragableMove)
				obj.addEventListener("pressup", dragableUp);
		
			});
		
		
		
			function dragableMove(e) {
		
				e.nativeEvent.preventDefault();
		
				obj.isdraged = true;
				var local = obj.parent.globalToLocal(e.stageX + obj.offset.x, e.stageY + obj.offset.y);
		
		
				var global = obj.parent.localToGlobal(obj.x, obj.y)
		
		
				if (local.y < 0 || local.y + objTransHeight >
					mins || local.x < 0 || local.x + objTransWidth >
					lib.properties["width"]) return;
				obj.x = local.x;
				obj.y = local.y;
		
				doSomeThing(current);
		
				//
		
			}
		
		
			function dragableUp(e) {
		
				if (obj.isdraged) {
					e.nativeEvent.preventDefault();
		
					var global = obj.parent.localToGlobal(obj.x, obj.y)
					obj.isLeft = global.x < (lib.properties["width"] / 2);
					obj.isdraged = false;
		
					obj.lastX = obj.x;
					obj.lastY = obj.y;
		
					obj.removeEventListener("pressup", dragableUp);
					obj.removeEventListener("pressmove", dragableMove)
				}
		
				stage.update();
			}
		
		
		}
		
