		function sbr_onpressmove(evt) {
		
		
			if (that.tool.geom.isClicked) {
		
		
				return;
		
			}
			var sbr = evt.currentTarget;
		
			if (that.tool.square.isClicked) {
		
				drawSq(evt);
				return;
			}
		
			if (that.drawAnti_Square) {
		
				drawAnti_Sq(evt);
				return;
			}
		
			if (that.tool.circle.isClicked) {
		
				drawCi(evt);
				return;
			}
		
			isMove = true;
		
			pt = sbr.globalToLocal(evt.stageX, evt.stageY);
		
		
		
		
		
			const {
				x, y
			} = {
				x: pt.x,
				y: pt.y
			}
			downarray.push({
				x, y
			});
		
			if (downarray.length > 3) {
				const lastTwoPoints = downarray.slice(-2);
				const controlPoint = lastTwoPoints[0];
				const endPoint = {
					x: (lastTwoPoints[0].x + lastTwoPoints[1].x) / 2,
					y: (lastTwoPoints[0].y + lastTwoPoints[1].y) / 2,
				}
		
		
		
				if (that.tool.mimsaha.iserase) {
		
					eraseShape([sbr.getChildByName('f_shapeDraw'), sbr.getChildByName('shapeDraw')], beginPoint, controlPoint, endPoint, that.tool.color, erserSomk * 2);
					beginPoint = endPoint;
				} else {
		
					if (that.tool.feutre.isClicked) {
		
		
		
						drawLine(sbr.getChildByName('f_shapeDraw'), beginPoint, controlPoint, endPoint, that.tool.f_color, that.tool.f_somk);
						beginPoint = endPoint;
		
		
					} else {
		
		
						drawLine(sbr.getChildByName('shapeDraw'), beginPoint, controlPoint, endPoint, that.tool.color, that.tool.somk);
						beginPoint = endPoint;
					}
		
		
				}
		
			}
		
		
		
		
			if (that.tool.mimsaha.iserase) {
		
				makeCursor(pt.x, pt.y);
		
			}
		
		
			//stage.update(); is not necessary ,ticker is sifficient
		
		}
		
		
		
		
		function drawLine(shap, beginPoint, controlPoint, endPoint, color = '#000', smk = 3, undo = false) {
		
		
			if (!undo && !tmrnAdded) {
		
		
				smootLine.push([beginPoint, controlPoint, endPoint]);
		
				allSmoot.length = allSmoot.length - undoCount[0];
				undoCount[0] = 0;
			}
		
			shap.graphics.beginStroke(color)
		
			.setStrokeStyle(smk, "round")
		
			.moveTo(beginPoint.x, beginPoint.y)
		
			.quadraticCurveTo(controlPoint.x, controlPoint.y, endPoint.x, endPoint.y);
		
			shap.updateCache("source-over");
		
			shap.graphics.clear();
		
		
		}
		
		
		function eraseShape(shap, beginPoint, controlPoint, endPoint, color, smk, undo = false) {
		
			if (!undo && !tmrnAdded) {
		
				smootLine.push([beginPoint, controlPoint, endPoint]);
		
				allSmoot.length = allSmoot.length - undoCount[0];
				undoCount[0] = 0;
			}
		
			for (var i = 0; i < shap.length; i++) {
				console.log('eraseShape(shap ', shap[i]);
				shap[i].graphics.beginStroke(color)
		
				.setStrokeStyle(smk, "round")
		
				.moveTo(beginPoint.x, beginPoint.y)
		
				.quadraticCurveTo(controlPoint.x, controlPoint.y, endPoint.x, endPoint.y);
		
				shap[i].updateCache("destination-out");
		
				shap[i].graphics.clear();
			}
		
		}
		
		function undoShape(backward) {
		
		
			if (that.tool.geom.isClicked) {
		
				undoAlpha();
		
				if (verList.length == 0) return;
		
				if (verList.at(-1).length == 0) {
		
					verList.pop();
					txtList.pop();
					valueToDrawAngleSmbl.pop();
		
					cOReList.pop();
		
				}
		
				if (verList.length == 0) return;
		
		
				var cur_sbr_children = getCurrent_sbr().children ;
				cur_sbr_children.at(-1).removeChildAt(cur_sbr_children.at(-1).numChildren - 1);
				verList.at(-1).pop();
				txtList.at(-1).pop();
				
				if (valueToDrawAngleSmbl.length != 0) valueToDrawAngleSmbl.at(-1).pop();
		
				cur_sbr_children.at(-2).removeAllChildren();
				
		
				drawVertex();
		
		
		
				return;
			}
		
		
			if (allSmoot.length != 0) {
		
				if ((undoCount[0] == allSmoot.length && backward) || (undoCount[0] == 0 && !backward)) return;
		
				sbr.getChildByName('shapeDraw').updateCache();
				sbr.getChildByName('f_shapeDraw').updateCache();
		
		
				var dir = backward ? 1 : -1;
		
		
				undoCount[0] += dir;
		
				for (var u = 0; u < allSmoot.length - undoCount[0]; u++) {
		
					var todo = allSmoot[u];
					var iserase = todo[0].at(-1);
					var sh = todo[0][0];
		
					console.log('toUndo[0][0]', todo[0][0]);
					var cl = todo[0][1];
					var smk = todo[0][2];
		
		
					if (iserase) {
		
						for (var t = 1; t < todo.length - 1; t++) {
		
							eraseShape(sh, todo[t][0], todo[t][1], todo[t][2], cl, smk, undo = true)
		
						}
		
					} else {
						for (var t = 1; t < todo.length - 1; t++) {
		
							drawLine(sh, todo[t][0], todo[t][1], todo[t][2], cl, smk, undo = true)
		
						}
					}
				}
			}
		}
		
		
