		function roundAngle(ang) {
		
		
		
			for (var i = 0; i < ang.length; i++) {
		
				var autoClose = cOReList[i] == 'c';
		
		
				var sumAngl = 0;
		
				for (var j = 0; j < ang[i].length - 1; j++) {
		
		
					ang[i][j] = Math.round(ang[i][j]); //Math.round(ang[i][j] * 100) / 100).toFixed(0);
		
					sumAngl += ang[i][j];
		
				}
				if (autoClose)
					ang[i][j] = 180 * (ang[i].length - 2) - sumAngl;
		
				else ang[i][j] = Math.round(ang[i][j]);
			}
		
			return ang;
		}
		
		
