		var valueToDrawAngleSmbl = [];
		
		function getAngle(listvrtx) {
		
			var listAnglCollec = [];
			var listAngl = [];
		
			var valueToDrawAngleSmblCollec = [];
			valueToDrawAngleSmbl = [];
		
		
		
			for (var i = 0; i < listvrtx.length; i++) {
		
		
				listAnglCollec = [];
				valueToDrawAngleSmblCollec = [];
		
				var autoClose = cOReList[i] == 'c';
		
				var finallist = listvrtx[i];
		
				if (autoClose && listvrtx[i].length > 2) { //even closed shape ,dont draw angles for two point
					var utilArray = [...listvrtx[i]];
					utilArray.push(listvrtx[i][0]);
					utilArray.unshift(listvrtx[i].at(-1));
					finallist = utilArray;
				}
		
				for (var j = 1; j < finallist.length - 1; j++) {
		
					var head = finallist[j];
					var y1 = head.y - finallist[j + 1].y;
					var x1 = head.x - finallist[j + 1].x;
					var y2 = head.y - finallist[j - 1].y;
					var x2 = head.x - finallist[j - 1].x;
		
					var angle1 = Math.atan2(y1, x1);
					var angle2 = Math.atan2(y2, x2);
		
		
		
					var sign = angle1 > angle2 ? 1 : -1;
					var angle = angle1 - angle2;
					var K = -sign * Math.PI * 2;
					var angle = (Math.abs(K + angle) < Math.abs(angle)) ? K + angle : angle;
					angle = Math.abs(angle) * 180 / Math.PI;
					listAnglCollec.push(angle);
		
		
					valueToDrawAngleSmblCollec.push([y1, x1, y2, x2, angle1, angle2, head]);
		
		
				}
		
				listAngl.push(listAnglCollec);
				valueToDrawAngleSmbl.push(valueToDrawAngleSmblCollec);
			}
			return listAngl;
		
		}
		
		
		function drawAnglesymbol(listOfValue, angles) {
		
			var anglesmbl = getCurrent_sbr().children.at(-6);
		
			var textCont = getCurrent_sbr().children.at(-2);
		
		
		
			for (var i = 0; i < listOfValue.length; i++) {
		
		
				for (var j = 0; j < listOfValue[i].length; j++) {
		
					var [y1, x1, y2, x2, a1, a2, head] = listOfValue[i][j];
					var angle = angles[i][j];
		
					if (x1 * y2 - y1 * x2 < 0) {
						const t = a2;
						a2 = a1;
						a1 = t;
					}
		
					// if angle 1 is behind then move ahead
					if (a1 < a2) {
						a1 += Math.PI * 2;
					}
		
		
					anglesmbl.graphics.f('#ff0000');
					anglesmbl.graphics.moveTo(head.x, head.y);
					anglesmbl.graphics.arc(head.x, head.y, 35, a1 + Math.PI, a2 + Math.PI);
		
		
		
					// get the mid point to put text 
					const mx = Math.cos((a1 + a2) / 2) * 50 + head.x;
					const my = Math.sin((a1 + a2) / 2) * 50 + head.y;
		
		
					txtList[i][j].x = mx;
					txtList[i][j].y = my;
		
		
					txtList[i][j].getChildAt(1).text = angle;
					textCont.addChild(txtList[i][j]);
		
				}
			}
			anglesmbl.updateCache();
			anglesmbl.graphics.clear();
		
		}
		
		
		
		
		
		
